"use strict";
module.exports = "<div class=\"usa-grid\">\n  <div Markdown *ngIf=\"forest && forest.content\" [data]=\"forest.content.permitRules\"></div>\n  <div Markdown *ngIf=\"forest && forest.content\" [data]=\"forest.content.rules\"></div>\n</div>\n";

