"use strict";
module.exports = "<section id=\"forest-finder-intro\" class=\"forest-hero {{'dot-' + selectedDot}}\">\n  <div class=\"forest-picker-hero\">\n    <div class=\"forest-picker-callout\">\n      <span class=\"callout-title\" id=\"skip-nav-target\" tabindex=\"-1\">Choose Your Permit</span>\n      <p>The USDA Forest Service invites you to obtain permits for select forest products now available online, with more to come in the future. <br/><br/> Get started by selecting your desired forest and product.</p>\n      <div id=\"forest-finder-form\">\n        <form name='forestPickerForm' class=\"usa-forms\" (submit)=\"goToForest(selectedForest)\" autocomplete=\"off\">\n          <span class=\"select-forest-label\">Select your forest</span>\n          <app-dropdown label=\"Select your forest\" id=\"forests-dropdown\" expandDirection=\"down\" [choice]=\"selectedForest\" [options]=\"forests\" key=\"friendly\" (selectedDropdownItem)=\"selectForest($event)\"></app-dropdown>\n          <span class=\"select-product\">Select a product</span>\n          <app-dropdown label=\"Select a product\" expandDirection=\"down\" [disabled]=\"selectedForest.id === ''\" [choice]=\"selectedProduct\" [options]=\"products\" key=\"friendly\" (selectedDropdownItem)=\"selectProduct($event)\"></app-dropdown>\n          <div id='forest-finder-error' aria-live=\"assertive\" [ngClass]=\"{ 'hidden': !showForestSelectError }\">\n            <span tabindex=\"0\" *ngIf=\"showForestSelectError\">You are required to choose a forest.</span>\n          </div>\n          <input role=\"button\" aria-label=\"Get Your Permit\" id='forest-finder-submit' [ngClass]=\"{'disabled': !selectedForest || !selectedProduct.type}\" [disabled]=\"!selectedForest || !selectedProduct.type\" type='submit' value='Get Your Permit' />\n        </form>\n      </div>\n    </div>\n    <div class=\"welcome-callout usa-section-light\">\n      <span>Welcome to Forest Service Special Forest Product E-Permit Application</span>\n    </div>\n    <!-- <div class=\"hero-dots\">\n      <span class=\"hero-dot\" *ngFor=\"let dot of heroDots; let i = index\" (click)=\"selectDot(i)\" [ngClass]=\"{'selected': heroDots[selectedDot] === dot}\"></span>\n    </div> -->\n  </div>\n</section>\n";

