/***/ 82381:
/*!*****************************************************************************************!*\
  !*** ./src/app/forests/order-confirmation/order-confirmation.component.html?ngResource ***!
  \*****************************************************************************************/
/***/ ((module) => {

"use strict";
module.exports = "<app-spinner *ngIf=\"isLoading\"></app-spinner>\n<div class=\"purchase-confirmation\" *ngIf=\"!isLoading\">\n  <app-buy-permits-header [forestName]=\"permit.forest.forestName\" [productName]=\"permit.product\" [permitStepLabels]=\"permitStepLabels\" [currentStepIndex]=\"currentStepIndex\"></app-buy-permits-header>\n  <app-stepper [steps]=\"permitStepLabels\" [currentStepIndex]=\"currentStepIndex\"></app-stepper>\n  <div class=\"content\">\n    <div class=\"side-content\">\n      <div class=\"side-content-info-logo\">\n        <img class=\"info-icon\" src=\"assets/img/icons/icon-info.svg\" alt=\"info icon\">\n      </div>\n      <div class=\"bold-text\">Did You Know?</div>\n      <div></div>\n      <div class=\"side-content-text\">\n        <p>Please have a printed physical copy of your permit with you while harvesting, along with a valid ID that matches the name on your permit.</p>\n        <div class=\"divider\"></div>\n        <p>You permit must be printed and with you to be valid. A copy on a mobile device is not acceptable at this time.</p>\n        <div class=\"divider\"></div>\n        <p>Maps and restrictions may be updated periodically throughout the lifecycle of your permit and can be obtained online and at ranger district offices.</p>\n      </div>\n    </div>\n    <div>\n      <h2>Print Permit</h2>\n      <p>Congratulations! Thank you for successfully completing your permit purchase. You can download and print your permit and other associated documentation below, or from the email sent to you at: <span class=\"bold-text\">{{ permit.emailAddress }}</span>. Your email will also contain all important information about your permit and this agreement.</p>\n      <div class=\"permit-info-header\">\n        <h3>Permit Info</h3>\n      </div>\n      <div class=\"permit-info\">\n        <div class=\"permit-info-content\">\n          <div>Product: <span class=\"bold-text\">{{ permit.product | titlecase }}</span></div>\n          <div>Forest: <span class=\"bold-text\">{{ forest.forestName }}</span></div>\n          <div>Quantity Purchased:\n            <span class=\"bold-text\">{{ permit.productQuantity }}\n              <span *ngIf=\"forest.product.unit_type === 'CCF'\">{{ forest.product.unit_type }}</span>\n              <span *ngIf=\"forest.product.unit_type !== 'CCF'\">{{ forest.product.unit_type }}s</span>\n            </span>\n          </div>\n          <div>Expires: <span class=\"bold-text\">{{ permit.permitExpireDate }}</span></div>\n        </div>\n        <div class=\"download-buttons-container\">\n          <div class=\"grid-item-container\">\n            <img class=\"info-icon\" src=\"assets/img/permit/permit_preview.jpg\" alt=\"Permit Preview\">\n          </div>\n          <div class=\"grid-item-container\"><a [ngClass]=\"permitHTML.length > 0 ? '' : 'disabled-link'\" (click)=\"downloadPermit()\">Download Permit</a></div>\n          <div class=\"grid-item-container\"><span>(PDF)</span></div>\n          <div class=\"grid-item-container\" *ngIf=\"forest.product.has_load_tags\">\n            <img class=\"load-tags-preview\" src=\"assets/img/permit/load_tags_preview.jpg\" alt=\"Load Tags Preview\">\n          </div>\n          <div class=\"grid-item-container\" *ngIf=\"forest.product.has_load_tags\" (click)=\"downloadLoadTags()\"><a>Download Load Tags</a></div>\n          <div class=\"grid-item-container\" *ngIf=\"forest.product.has_load_tags\"><span>(PDF)</span></div>\n        </div>\n      </div>\n      <a class=\"link\" *ngIf=\"forest.mapUrl.endsWith('.pdf')\" [href]=\"forest.mapUrl\" target=\"_blank\">Important Harvesting Area Maps</a>\n      <a class=\"link\" [href]=\"permitInfoUrl\" target=\"_blank\">Prohibited Area & Restriction Information</a>\n      <p>It is the responsibility of the permit holder to review the list of prohibited areas and restrictions, and forest maps, before harvesting. Also know that it is your responsibility to read and understand the terms which are included with your permit, and to check online and with local offices periodically for map updates. Law Enforcement Officers may stop and ensure that the terms of the permit are being met.</p>\n      <br />\n      <div class=\"warning-message-container\">\n        <span><span class=\"bold-text\">IMPORTANT:</span> \n        <ul>\n          <li>Permittee must have a valid ID to match the name on the permit.</li>\n          <li>You must have a printed copy of the permit (and load tags if provided) with you when harvesting and transporting products.</li>\n          <li>Digital copies are not accepted.</li>\n        </ul>\n      </span>\n      </div>\n    </div>\n  </div>\n</div>\n";

/***/ }),

